  return (
    <header className="header">
      <img
        className="header__logo"
        src={logoPath}
        alt="логотип место"
      />
       <Route path="/sign-in">
                <Link
                    className="header__link"
                    to="sign-up">
                    {signUp}
                </Link>
            </Route>

            <Route path="/sign-up">
                <Link
                    className="header__link"
                    to="sign-in">
                    {signIn}
                </Link>
            </Route>

